import React from "react";
import TodoForm from "./TodoForm";

import { Paper } from "@material-ui/core";

function TodoApp() {
  const { addTodo } = useTodoState(initialTodos);
  return (
    <Paper>
      <TodoForm addTodo={addTodo} />
    </Paper>
  );
}

export default TodoApp;
